class LongestSubstring {
    func lengthOfLongestSubstring(_ s: String) -> Int {
        var temp = ""
        var result = 0
        var remainingS = s
        
        while remainingS.count > 0 {
//            print(remainingS)
            for c in remainingS.enumerated() {
                if let firstRepeatedIndex = temp.firstIndex(of: c.element) {
                    result = max(temp.count, result)
                    let k = temp.distance(from: temp.startIndex, to: firstRepeatedIndex) + 1
//                    print("k =", k)
                    remainingS = String(remainingS.dropFirst(k))
//                    print("\(result) - \(remainingS)")
                    temp.removeAll()
                    break
                } else {
                    temp.append(c.element)
//                    print("\(c) - \(temp)")
                }
            }
        }
        
        return result
    }

